import React from "react"
 
function Itservices()
{
    return (
        <>
        <h2>Itservices</h2>
        <p>
            IT services are technology functions that are offered with support and management. 
            This allows customers to use information technology without managing complexities such 
            as maintenance, security, scalability and resilience. IT services may be offered by 
            internal teams or external partners.
        </p>        
    </>
    )
}
export default Itservices;
